def pengurangan_bersusun(a_str, b_str):
    """
    Melakukan pengurangan bersusun (cara umum) dua bilangan besar dalam bentuk string.
    Hanya untuk a >= b.
    """
    # Pastikan kedua bilangan memiliki panjang yang sama
    max_len = max(len(a_str), len(b_str))
    a_str = a_str.zfill(max_len)
    b_str = b_str.zfill(max_len)

    hasil = []
    pinjam = 0

    # Proses dari digit paling kanan ke kiri
    for i in range(max_len - 1, -1, -1):
        digit_a = int(a_str[i])
        digit_b = int(b_str[i]) + pinjam

        if digit_a < digit_b:
            digit_a += 10
            pinjam = 1
        else:
            pinjam = 0

        hasil.append(str(digit_a - digit_b))

    # Hasil masih terbalik, balikkan dan hilangkan nol di depan
    hasil_str = ''.join(reversed(hasil)).lstrip('0')
    return hasil_str if hasil_str else '0'

if __name__ == "__main__":
    import time
    print("Pengurangan Bersusun (Cara Umum)")
    a = ""
    b = ""

    # Pastikan a >= b
    if len(a) < len(b) or (len(a) == len(b) and a < b):
        print("Error: Bilangan yang dikurangi harus lebih besar atau sama dengan bilangan pengurang.")
    else:
        start_time = time.time()
        hasil = pengurangan_bersusun(a, b)
        end_time = time.time()
        print(f"Waktu eksekusi: {end_time - start_time:.6f} detik")